import { makeStyles } from "@material-ui/styles";

export const useStyles = makeStyles((theme) =>({
    text:{
        fontSize:1.25,
    },
    todo:{
        display: "flex",
        justifyContent:"space-between",
        alignItems:"center",
        borderRadius:"5px",
        padding: 23,
        margin:"5px 0"
    }
}))
